import React from 'react';
import ReactDOM from 'react-dom';
//import './index.css';
import App from './App'
import * as serviceWorker from './serviceWorker';
//import $ from 'jquery';
//import $ from 'jquery';
//import './css/jquery.mobile-1.2.1.min.css';

//ReactDOM.render(<App />, document.getElementById('root'));

window.webservices="";
//window.webservices="";
//window.webservices="";


const startApp = (cordovaWork) => {
  ReactDOM.render(
    <div style={!cordovaWork&&window.innerWidth>1000?{width:"600px"}:{}}>
    <App cordovaWork={cordovaWork}/>
    </div>,
    document.getElementById('root')
  );
}
//
//  alert(window.cordova);
//  alert(JSON.stringify(window.cordova));

if (!window.cordova) {
  startApp(false)
} else {

  document.addEventListener('deviceready', () => {
    startApp(true);
  }, false);
  // alert(deevice.cordova);

  // window.device && device.platform === 'iOS'? 
  //  alert(window.device.platform);
  // alert(window.cordova);
  //  alert(JSON.stringify(window.cordova));
}



// If you want your app to work offline and load faster, you can change
